import React from "react";
import LocalShippingIcon from '@material-ui/icons/LocalShipping';
import CheckCircleOutlineIcon from '@material-ui/icons/CheckCircleOutline';
import PhoneCallbackIcon from '@material-ui/icons/PhoneCallback';

export default function ConpleteOrder(){
    return(
        <div style={{color:"darkorange", textAlign:"center"}}>
        <h1 style={{fontSize:"4vw", color:"darkorange"}}>Chúc Mừng ! <CheckCircleOutlineIcon style={{fill: "green"}} /></h1>
        <h1 style={{fontSize:"3vw", color:"darkorange"}}>Đơn hàng của bạn đã được đặt thành công !</h1>
        <p style={{fontSize:"1.8vw",}}><strong style={{fontSize:"2.3vw",color:"white"}}>Xin hãy giữ liên lạc !<PhoneCallbackIcon /></strong><br/>
        Nhân viên chúng tôi sẽ liên hệ với bạn để xác nhận đơn hàng trong ít phút.</p>
        <p style={{fontSize:"1.8vw",}}><strong style={{fontSize:"2.3vw",color:"white"}}>Vui lòng đợi chúng tôi ! <LocalShippingIcon /></strong><br/>
        Đơn hàng sẽ được giao đến bạn trong 45' sau khi xác nhận đơn hàng.</p>       
        <button className="btn btn-outline-danger" style={{textAlign:"center"}}>Quay Trở lại Trang Chủ ></button>
        </div>
    )
}
